INSERT INTO `tb_model` VALUES ('1003', '年龄、职业信息异常', '投保人、被保险人、受益人职业为“内勤”时，男性年龄＞65 周岁或女性年龄＞60 周岁时，或，无论男女年龄<18周岁');
INSERT INTO `tb_model` VALUES ('1004', '证件信息异常', '证件\r\n（1）户口本\r\n证件类型为“户口本”时，证件号码须填写身份证号，年龄≥16 周岁,不允许使用“户口本”\r\n（2）出生证\r\n证件类型为出生证时，证件号码须为字母+9 位数字\r\n（3）护照\r\n证件类型为“护照”时，国籍不能为中国');
INSERT INTO `tb_model` VALUES ('1005', '客户地址不详或疑似网点地址', '地址\r\n1）详细地址（街道）第一个字须为汉字；\r\n2）详细地址（街道）仅允许包含特殊字符“-”、“#”；\r\n3）详细地址（街道）不能包含“邮政储蓄”、“邮局”、“营业厅”、“邮政”等；\r\n4）详细地址（街道）最后一个字必须是汉字，不能以“区”、委”“省”、“市”、“县”、“镇”、“乡”、“路”、街”、“道”结尾，结尾须包含“楼”、“村”、“巷”、“胡同”、“里弄”、“号”、“大厦”、“栋”、“幢”、“室”、“号”、“单元”、“门”、“组”、“房”、“座”、“层”、排”中至少一个');
INSERT INTO `tb_model` VALUES ('1006', '多名客户使用同一地址', '相同的地址大于4');
INSERT INTO `tb_model` VALUES ('1007', '疑似规避双录', '1.提取辖内时间段保险交易明细，筛选出交易渠道非柜面的相关交易。2.关联储蓄流水表，上述交易客户发生保险交易当天或前一天在购买机构下的ATM、ITM、柜台有过交易的数据保留。3.对上述数据再与双录系统关联，把双录系统没有记录的交易保留。');
