-- ----------------------------
-- View structure for v_count_dept
-- ----------------------------
DROP VIEW IF EXISTS `v_count_dept`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_count_dept` AS SELECT 
	td.city_name,
	td.city_id,
	td.dist_name,
	td.dist_id,
	sum(t1.num) total_alert_num,
	sum(case t1.`status` when '0' then t1.num else 0 END ) last_alert_num,
	sum(case t1.`status` when '1' then t1.num else 0 END ) not_check_alert_num,
	sum(case t1.`status` when '2' then t1.num else 0 END ) check_alert_num
from (
SELECT
	ta.branch_id,
	ta.`status`,
	count(1) num
FROM
		tb_user_alert ta
GROUP BY
		ta.branch_id,
		ta.`status`
) t1
LEFT JOIN
	tb_dept td on td.branch_id = t1.branch_id
GROUP BY
	td.city_name,
	td.city_id,
	td.dist_id,
	td.dist_name 
ORDER BY
	td.city_id,
	td.dist_id ;

-- ----------------------------
-- View structure for v_count_model
-- ----------------------------
DROP VIEW IF EXISTS `v_count_model`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `v_count_model` AS SELECT 
	t1.model_id,
	tm.model_name,
	sum(t1.num) total_alert_num,
	sum(case t1.`status` when '0' then t1.num else 0 END ) last_alert_num,
	sum(case t1.`status` when '1' then t1.num else 0 END ) not_check_alert_num,
	sum(case t1.`status` when '2' then t1.num else 0 END ) check_alert_num
from (
	SELECT
		ta.model_id,
		ta.`status`,
		count(1) num
	FROM
			tb_user_alert ta
	GROUP BY
			ta.model_id,
			ta.`status`
) t1
LEFT JOIN
	tb_model tm ON tm.model_id = t1.model_id
GROUP BY
	t1.model_id,
	tm.model_name ;

