-- Procedure structure for proc_alert_model01
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_alert_model01`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_alert_model01`()
BEGIN
	/*********************************************************************
    存储过程名称：  proc_alert_model01
    存储过程描述：  预警模型1-投保时，判断投保人使用的手机号码是否存在已有不同客户使用该手机号码
    作者：          lushengle
    时间：          2022-12-28
    参数说明：
      无
**********************************************************************/
		order_num,
		email,
		phone,
		sex,
		age,
		job_title,
		id_type,
		id_card,
		nationality,
		address,
		dept_id,
		dept_name,
		branch_id,
		branch_name,
		start_date,
		model_id
	) SELECT
			tu2.order_num,
			tu2.email,
			tu2.phone,
			tu2.sex,
			tu2.age,
			tu2.job_title,
			tu2.id_type,
			tu2.id_card,
			tu2.nationality,
			tu2.address,
			tu2.dept_id,
			tu2.dept_name,
			tu2.branch_id,
			tu2.branch_name,
			tu2.start_date,
			'1001'
		FROM
			tb_user tu2
		INNER JOIN (
			SELECT
				tu.phone
			FROM
				tb_user AS tu
			GROUP BY
				tu.phone
			HAVING
				count(tu.phone) > 1
		) t1 ON t1.phone = tu2.phone;


END
;;
DELIMITER ;

