-- ----------------------------
-- Procedure structure for proc_alert_model03
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_alert_model03`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_alert_model03`()
BEGIN
	/*********************************************************************
    存储过程名称：  proc_alert_model03
    存储过程描述：  预警模型3-投保人、被保险人、受益人职业为“内勤”时，男性年龄＞65 周岁或女性年龄＞60 周岁时，或，无论男女年龄<18周岁
    作者：          lushengle
    时间：          2022-12-28
    参数说明：
      无
**********************************************************************/

	-- 3、投保人、被保险人、受益人职业为“内勤”时，
	-- 男性年龄＞65 周岁或女性年龄＞60 周岁时，或，无论男女年龄<18周岁
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1003'
	FROM
		tb_user tu 
	where 
		(tu.job_title = '内勤人员' and tu.age <18)
		or (tu.job_title = '内勤人员' and tu.age > 65 and tu.sex = '男' ) 
		or (tu.job_title = '内勤人员' and tu.age > 60 and tu.sex = '女' );


END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for proc_alert_model04
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_alert_model04`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_alert_model04`()
BEGIN
	/*********************************************************************
    存储过程名称：  proc_alert_model04
    存储过程描述：  预警模型4--- 4、证件异常
															-- （1）户口本
															-- 证件类型为“户口本”时，证件号码须填写身份证号，年龄≥16 周岁,不允许使用“户口本”
															-- （2）出生证
															-- 证件类型为出生证时，证件号码须为字母+9 位数字
															-- （3）护照
															-- 证件类型为“护照”时，国籍不能为中国
    作者：          lushengle
    时间：          2022-12-28
    参数说明：
      无
**********************************************************************/

	#（1）户口本
		tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1004'
		FROM
			tb_user tu
		WHERE
			tu.id_type = '户口本'
			AND (tu.age >= 16 OR tu.id_card NOT REGEXP '(^\d{15}$)|(^\d{18}$)|(^\d{17}(\d|X|x)$)');

	
	#(2)出生证
		tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1004'
	FROM
			tb_user tu
	WHERE
			tu.id_type = '出生证'
			AND tu.id_card NOT REGEXP '^[a-zA-Z]+[0-9]{9}$';
	
	
	#(3)护照
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1004'
	FROM
			tb_user tu
	WHERE
		tu.id_type = '护照'
		AND tu.nationality = '中国';



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for proc_alert_model05
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_alert_model05`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `proc_alert_model05`()
BEGIN
	/*********************************************************************
    存储过程名称：  proc_alert_model05
    存储过程描述：  预警模型5-地址异常
							1）详细地址（街道）第一个字须为汉字；
							2）详细地址（街道）仅允许包含特殊字符“-”、“#”；
							3）详细地址（街道）不能包含“邮政储蓄”、“邮局”、“营业厅”、“邮政”等；
							4）详细地址（街道）最后一个字必须是汉字，不能以“区”、委”“省”、“市”、“县”、“镇”、“乡”、“路”、街”、“道”结尾，
							结尾须包含“楼”、“村”、“巷”、“胡同”、“里弄”、“号”、“大厦”、“栋”、“幢”、“室”、“号”、“单元”、“门”、“组”、“房”、“座”、“层”、排”中至少一个
    作者：          lushengle
    时间：          2022-12-28
    参数说明：
      无
**********************************************************************/

-- 1）详细地址（街道）第一个字须为汉字；
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1005'
	FROM
		tb_user tu
	WHERE
		hex(tu.address) not REGEXP "^e[4-9][0-9a-f]{4}";



	-- 2）详细地址（街道）仅允许包含特殊字符“-”、“#”；-- 中文、英文、数字、"#"、"-"
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1005'
	FROM
		tb_user tu
	WHERE
		hex(tu.address) not regexp '[[:<:]](e[4-9][0-9a-f]{4}|3[0-9]|4[0-9A-F]|5[0-9A]|6[0-9A-F]|7[0-9A]|5F|[x23]|[x2d])+[[:>:]]'; 


	-- 3）详细地址（街道）不能包含“邮政储蓄”、“邮局”、“营业厅”、“邮政”等；
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1005'
	FROM
		tb_user tu
	WHERE
		tu.address regexp '(邮政储蓄|邮局|营业厅|邮政)';



	-- 4）详细地址（街道）最后一个字必须是结尾须包含“楼”、“村”、“巷”、“胡同”、“里弄”、“号”、“大厦”、“栋”、“幢”、“室”、
	-- “号”、“单元”、“门”、“组”、“房”、“座”、“层”、排”中至少一个
			tb_user_alert(order_num,email,phone,sex,age,job_title,id_type,id_card,nationality,address,dept_id,dept_name,branch_id,branch_name,start_date,model_id) 
	SELECT
			tu.order_num,tu.email,tu.phone,tu.sex,tu.age,tu.job_title,tu.id_type,tu.id_card,tu.nationality,tu.address,tu.dept_id,tu.dept_name,tu.branch_id,tu.branch_name,tu.start_date,'1005'
	FROM
		tb_user tu
	WHERE
		tu.address not regexp '.+(楼|村|巷|胡同|里弄|号|大厦|栋|幢|室|号|单元|门|组|房|座|层|排)$';




END
;;
DELIMITER ;

